import React from 'react';
import './FaceRecognition.css';
const FaceRecognition = ({imgUrl,box}) => {
    return(
        <div classNNNameName='center ma'>
            <div classNNNameName='absolute ma2'>
                <img id='inputimage' alt='' src={imgUrl} width='300px' height='auto' />
                <div classNNNameName='bounding-box' style={{left:box.leftCol,top:box.topRow,right:box.rightCol,bottom:box.bottomRow}}></div>
            </div>
        </div>   
    );
}

export default FaceRecognition;
